import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { RenderListComponent } from './render-list/render-list.component';
import { CreateListComponent } from './create-list/create-list.component';
import { UpdateListComponent } from './update-list/update-list.component';

const routes: Routes = [
  { path: '', component: RenderListComponent },
  { path: 'create', component: CreateListComponent },
  { path: 'update/:id', component:  UpdateListComponent},
  // { path: 'delete/:id', component:  }

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
